// import logo from "./logo.svg";
import "./App.css";
import data from "./users.json";

function App() {
    return(
        data.map((user) => {
            return(
                <div className='box' key={user.id}>
                    {user.first_name}
                </div>
            )
        })
    )
}

export default App;
